    return (
        <Router>
            <div className="app-container">
                <Routes>
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/dashboard" element={<Dashboard />} /> {/* Rota para a tela de quem est√° logado */}
                </Routes>
            </div>
        </Router>
    );
}

export default App;
